  const onSubmit = useCallback(() => { }, []);
  return (
    <>
      <Head>
        <title>회원가입 | NodeBird</title>
      </Head>
      <AppLayout>
        <Form onFinish={onSubmit}>aa</Form>
      </AppLayout>
    </>
  );
}

export default Signup;
